### 4.4 Alternative Approach

To end this section, we explain an alternative approach to the problem (3). We can also solve the problem by updating all vertices simultaneously, not one by one. It means moving all the points $\left\{x_{i}\right\}_{i \in V}$ to arbitrary positions and then assigning all these $|V|$ points to the nearest points on $Q^{\text {hex }}$. The optimal assignment for $\left\{x_{i}\right\}_{i \in V}$ to $Q^{\text {hex }}$ is computable by a Hungarian algorithm in $\mathcal{O}\left(|V|^{3}\right)$ time or some heuristic.

They offer advantages such as simplified implementation or avoiding random access to arrays.

```
Algorithm 1: Proposed algorithm for the initial
placement
    Input: Graph \(G=(V, E)\), Weight \(\left(a_{i, j}\right)_{\{i, j\} \in E}\),
        Parameters \(N_{\text {iter }}^{\mathrm{CN}} \in \mathbb{N}\), and \(t_{0}>0\)
    Output: Initial placement \(X=\left(x_{1}, \ldots, x_{n}\right)\)
    \(t \leftarrow t_{0}\)
    2 Sample \(x_{i} \in Q^{\text {hex }}\) for all \(i \in V\) without replacement;
    for \(m \leftarrow 0\) to \(N_{\text {iter }}^{\mathrm{CN}}\) do
        Select vertex \(i \in V\) randomly;
        Draw \(r \in \mathbb{R}^{2}\) randomly from a unit circle;
        \(x_{i}^{\text {new }} \leftarrow \operatorname{round}\left(x_{i}-\nabla^{2} f_{i}\left(x_{i}\right)^{-1} \nabla f_{i}\left(x_{i}\right)+t \cdot r\right)\);
        if \(\exists j \in V\) such that \(x_{j}=x_{i}^{\text {new }}\) then
            \(x_{j} \leftarrow x_{i}\);
            \(x_{i} \leftarrow x_{i}^{\text {new }} ;\)
            \(t \leftarrow t-t_{0} / N_{\text {iter }}^{\mathrm{CN}}\)
    \(x_{i} \leftarrow s^{*} x_{i}\) for all \(i \in V\) with \(s^{*}\) given by Eq. (5);
    return \(X\)
```
